INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('626db10a24b3330050fbfcf0','DallasBob',335787,'I''m just an ordinary joe.  I''ve never played the game this movie is adapted from but from what I hear it''s pretty fun.  The movie itself is okay for a treasure hunting movie.  The action is good and keeps flowing, and the actors, Holland (latest Spiderman) and Whalberg seem to have good chemistry.  Even the female protagonist did well in her "diverse & inclusive" part.  
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('627898f072d8551308daedf4','JPV852',335787,'Good adventure-thriller in the vein of Tomb Raider. Visual effects for the most part were decent and liked seeing Tom Holland in a lead role other than Spider-Man (where he excels) and he''s good here. Now this is coming from someone who has never played the game but I thought as video adaptations go, it was fairly entertaining though nothing exceptional. **3.5/5**');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('631c3dca0bb0760080232889','Dark Jedi',335787,'This movie was pretty much what I expected or rather hoped for. It was a fun adventure/action rollercoaster plain and simple. This is one of those, rare nowadays, movies that are meant to entertain plain and simple. Two hours of adventure, action and twists barely held together by a rudimentary story and no woke rubbish or bullshit preaching. The latter is probably what rendered it a 40% rotten â€œcriticsâ€ score on woke tomatoes while the audience gave it a 90% fresh score. As almost always a rotten score on woke tomatoes is an indication that it is a movie worthwhile watching.
