INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('629470aca44d090067b777ba','Geronimo1967',361743,'It seems like I have been watching the trailers for this film for years now - and you know what? Yes - it was worth the wait. The film is all about some truly exhilarating aerial photography that culminates in some super dogfighting and a good old dose of nostalgia. Tom Cruise is very much in his element as the ageing - and frequently not afraid to look it - eponymous "Top Gun" pilot drafted in by a rather sceptical admiral to train up a new squad for a very perilous mission to destroy an underground uranium enrichment facility. The team arrive - full of hormones - and he must whip them into shape, a task made more difficult by the presence of "Rooster" (Miles Teller) who is the son of his old mate "Goose" who came to a sticky end last time out in 1986. He also gets to rekindle his romance with bar owner "Penny" (Jennifer Connelly) whilst all under the protection of his former wingman, now the poorly retired admiral "Kazansky" (Val Kilmer). To be honest, the story isn''t really up to much - there are some twists and turns, the script is not without some humour but there is no jeopardy really. We all know what is going to happen in the end. That said, though, everyone is on good form; the pace (aside from the interludes with Connelly which do rather abruptly slow things down a bit) is consistently action packed and the imagery from both inside and outside of these amazing pieces of machinery is not at all repetitive and is compelling to watch. Even the usual gung-ho, ye-ha stuff is kept to a minimum - this is a superior film depicting the US military at it''s most competitive, but also at it''s most intelligent - and I really quite enjoyed it. Big screen photography - don''t wait til it is on the telly.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6298c0207e12f02c82337cbb','ChrisSawin',361743,'_Top Gun: Maverick_ is a sequel that is a leaps and bounds improvement over the original film. Thereâ€™s better acting from the entire cast, more of an emotional attachment between at least two of the main characters in the film, and subtle humor that actually lands. But the filmâ€™s constant need to fly in the same flight pattern as the original film comes off as more of a restraint than a fond recollection.
