INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b0614f568463006125f78a','JustEntertainment',361743,'Haven''t seen a movie this perfect in decades. It was most obviously written and directed with the audience in mind - no politics, no preaching, no gratuitous sex, no woke, no offensive casting or characters. Brilliant, simplistic screenwriting and thrill rides. The original, if you''ve seen it, was iconic as it was, and to know it makes the second film here more enjoyable, but even if you''re not familiar with the background of the characters it''s clearly presented enough to be a stand-alone enjoyable film.');
