INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('626fc7d66f53e11b4c0d0015','Geronimo1967',396194,'This is a must see for fans of great cinema music. Perhaps alongside John Williams and John Barry, the eponymous maestro has scored in an unique and innovative way, a great many films since the 1960s and this film tracks how he rose from a classical music training to an (eventual) Oscar winner. It does suffer from the perennial problem of films like this, we see (and hear) too little of his marvellous works - especially my own favourite "Ecstasy of Gold" - but the narrative offers a quickly paced series of contributions from those well known, and those less so. It is astonishing just how many films he did provide the music for, some of it truly memorable and some of it truly dreadful - but here we see a man who never shied away from pushing the boundaries. His creative use of vocals, even of a typewriter to create his sounds demonstrates well his almost boundless imagination. Though at times a little dry, this documentary lays that skill and passion engagingly before us. Bertolucci, Eastwood and JoffÃ© all contribute in a fashion that avoids the adulatory, and makes this an enjoyable chronology not just of Morricone himself, but of world cinema too.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624b1f7e08cf87006316071a','Geronimo1967',399178,'Whilst at times a bit messy, Terence Davies and Jack Lowden have put together quite a compelling story of the life (and loves) of acclaimed British poet Siegfried Sassoon. Though not a conscientious objector - he got an MC in France during WWI, he regaled against the wartime policies of the Government and was invalided to an hospital near Edinburgh, where under the care of Dr. Rivers (Ben Daniels) he began to explore his sexuality and to fall in love for the first time (here, with an other equally acclaimed WWI poet Wilfred Owen (Matthew Tennyson)). The film uses two timelines to tell the story. The first, more of a chronology as Sassoon meets and loves the handsome yet frequently unreliable and scathing Ivor Novello (Jeremy Irvine) and Calam Lynch''s excellent portrayal of Stephen Tennant. The second, less developed, strand takes a more up-to-date position with Peter Capaldi, a somewhat disillusioned and curmudgeonly old fellow. As the young man''s story is told, we begin to understand a little more about why the older is whom he has now become - and that is all told poignantly with a gentle, if sparing, contribution from Gemma Jones as his long-suffering wife. Intercut with actuality from the Somme (not for the squeamish) and with the on-form Lowden (who frequently reminds be, here, of James McAvoy) reading some of Sassoon''s more potent poetry and, especially at the end reading one of Owen''s, this stylishly produced film provides much food for thought. The quality of the narrative ebbs and flows a bit, but for the most part it works well with an excellent ensemble in support. The marvellously catty Simon Russell Beale as Robbie Ross and Lia Williams as a superbly aloof Edith Sitwell make for a characterful study of a class of society in which homosexuals thrived; creatives created and stress, guilt and angst were really and enduringly affecting the lives of all.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('61fde077fcec2e00e14529aa','ChrisSawin',406759,'With Moonfall, Roland Emmerich has essentially made an even dumber version of Michael Bayâ€™s Armageddon. Thereâ€™s not a lot to enjoy here apart from K.C. Housemanâ€™s house cat being named Fuzz Aldrin. With its idiotic premise, hammy dialogue involving some of the most exaggerated emotional speeches ever, stiff acting, unfunny humor, and purposely distorted CGI, Moonfall features an overwhelming amount of frenetic nonsense and has no excuse to be as boring as it is.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6203a10bea37e0009451a99f','tmdb81678279',406759,'After watching the movie, I thought that if I had watched it on a streaming platform I would wish I caught it in the cinemas. Luckily I watched it on an IMAX cinema so the screen was huge and the sound was great, dialague was loud and clear. It had an entense tone to it to keep my attention. There were jokes here and there, but nothing major to distract me at all. I liked that it starts a bit slow and builds up, the second half is what remind me why I go to the cinemas, non-stop action and greatly done shots that you wish to put on your computer screen. It''s science fiction film that captivates your imagination. The plot and ideas I found very interesting. I enjoyed the movie, so I would recommend to catch it in the cinemas. Bigger cinema, the better. My only complaint is that it couldn''t take advantage of the full IMAX screen that was available, probably due to budget constraints.');
