INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6222823ee258600046cc75b8','mooney240',414906,'The reviews and hype for this movie were massive!  Comparisons to The Dark Knight got my expectations high... probably a little too high.  I was expecting to be blown away and was not but even with that being said The Batman is an exceptional film.  The cinematography and visuals are stunning.  Matt Reeves made some genius creative choices among which were the more reclusive rockstar grungy Bruce Wayne and the Riddler being heavily influenced by the Zodiac.  The acting was fantastic as well with Zoe Kravitz and Paul Dano offering some standout performances.  The Batman is driven with psychological and mystery focus as compared to the action comedy style of most superhero movies.  My only complaint is that the mystery felt fairly predictable.  I wasn''t surprised by any of the twists and turns.  Ultimately, this was a wonderful addition to the Batman franchise and I can''t wait to see where it goes next.');
