INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62c27f3a28723c2215c481b2','Geronimo1967',438148,'Eleven year old ''Gru" is asked by his school teacher what he wants to be when he grows up. "A super villain" he retorts - to the derision of his classmates. Little do they know, though, that he has applied to join the "Vicious Six" who have, themselves, just dumped their founder member "Wild Knuckles". They aren''t so impressed when he turns up at the interview but he uses his newly designed glue-gun to escape with their all powerful, emerald encrusted, stone. Now the five are on the warpath as he entrusts the stone to his minion friend "Otto", but he manages to swap it for a pebble with eyes so now embarks on a mammoth cycle ride to fetch it back whilst the pursuing villains cause havoc. Luckily, "Wild Knuckles" hasn''t given up. He kidnaps "Gru" to get the stone back, but when he realises that he no longer has it, the two form an unlikely, and quite amusing, partnership to retrieve it. I guess I''m just the wrong demographic for this, because although it hits the ground running and never stops for breath, I just didn''t really get it. The yellow ovoid creatures are fun, but hardy the stuff of big screen entertainment and the plot reminded me of the recently released "Bad Guys" animation that I didn''t much like either. It''s my first foray into "Despicable" territory, but the slapstick approach to the whole thing will probably ensure it''s my last. Others will love it, I''m sure - the cinema on a Sunday night was packed to the rafters, but this hadn''t enough for the grown up in me to remain engaged for long.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62d3db4191745b004f25a329','allthingsmoviesandtv',438148,'It sure has been a long wait for the sequel (7 years to be precise) but I think it''s safe to say that the film does not disappoint. While the film lacks a strong plot and is louder than its prequel, it easily covers up with delightful comedy, a sprinkle of nostalgia and a satisfying dose of lovable Minions!');
