INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6271cf31c74eba0f0f0c9316','ChrisSawin',453395,'_Doctor Strange in the Multiverse of Madness_ is dark, silly, and fan pleasing. The film is at is most bewitching when Sam Raimi can let his horror roots be showcased. It will satisfy horror and superhero film fans alike, but would have and could have been even better if Raimi was allowed to dive even further into the horror genre. Be sure to stay after the credits, as well. There are two after credits sequences with the final one being so absurdly on the nose for Sam Raimi that it may be the most entertaining part of the film.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('627599e61b1f3c0051e4d96d','msbreviews',453395,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/doctor-strange-multiverse-madness-spoiler-free-review
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('629381a2cddbbc74b3081465','Geronimo1967',453395,'Whilst I really did quite enjoy this - and it was great to be in a busy cinema again - it''s really more of a testament to the skills of the VFX guys rather than to any of the writers. The story is really pretty thin with the engaging and confident Benedict Cumberbatch joining forces with the charismatic and feisty young Xochitl Gomez'' "America" - a young lady who has been appearing in his dreams. Turns out, she can cross from one universe to another - and soon both are being sought by the mighty Elizabeth Olsen''s "Wanda Maximoff" (surely a "Bond" girl?) who wants control of time so she can get back to her lost family, yada yada... Benedict Wong features sparingly, but always adds a little value as the "Sorcerer Supreme" and there are a few cameos from Charlize Theron and Sir Patrick Stewart to help prop up what is, admittedly, a pretty meagre second half. I think this multiverse strand could provide Marvel with the gift that keeps on giving, but they have got to tighten the pace up - two hours for this was just too long; the plot doesn''t sustain it and though the combat scenes are nothing to the length in the "Avengers" movies; there is still far too much slack here. It does look and sound great on a big screen, though, and I am now warming to the star in the role (and his intuitive flying cape). Fun, but flawed.');
