INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62bdf88cc6006d0051490100','TitanGusang',453395,'Dr. Strange explores the multiverse even further than Spider-Man: No Way Home. It was extremely entertaining, and Sam Raimi brought a good amount of horror to the MCU, even though I would have preferred slightly more. Both Dr. Strange and Scarlet Witch stole the show and really made this movie for me. Many movies you wish it were a bit shorter, but with Multiverse of Madness, I really wish we got 15 more minutes. A lot happens in a short 2-hour chunk, and pacing would have been much better if it were given a slightly longer run time.
