INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62d04dc56d9fe809442a19cc','itsogs',453395,'First of all, let me say that I enjoyed the first Doctor Strange along with many other projects Benedict was involved in, but this one removed all the sanity and introduced horrific and woke garbage that simply destroyed this movie for me. Somehow they managed to take a perfectly acceptable character and transform it into crazy madness and barbaric nonsense. Even those initial stumbling blocks I could have gotten past, but Disney decided to interject their woke garbage into this movie like many other new shows which has now put them on a blacklist for so many others like me. Not sure I would ever pay or even ''watch for free'' anything by this company again, but that is me. I have standards, and clearly Disney is determined to brainwash their viewers with woke trash. So (for me) this movie doesn''t move the needle, in fact I consider it a waste of my time. ðŸ§»ðŸš½ðŸª ðŸš«ðŸ¤®');
