INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('631fa2e2b87aec007f89f1cd','robbiegrawey',453395,'I loved it even more on a second go-around; I''m a sucker for Raimiâ€™s little flourishes. Adore the cinematography and how personally compelling the character-work is. Also, realizing that this may be my favorite work from Cumberbatch, he is really magnetic and controlled here.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('63637c0fd75bd6007b6ef5f1','Geronimo1967',497828,'I did quite enjoy this, but it''s far too long and I found that the funniest bits had all already been seen in the trails! Initially, it centres around the fairly tempestuous relationship between models "Carl" (Harris Dickinson) and "Yaya" (Charlbi Dean). The latter is an influencer who looks at their relationship as something more transient; he is much more besotted - and so vows to make her fall in enduring love with him. Off onto a luxury yacht they head for an holiday with a few millionaires run by the super-officious "Paula" (Vicki Berlin) and captained by the dipsomaniac Woody Harrelson. The two befriend the lively and charismatic Russian oligarch "Dimitry" (Zlatlo Buric) and his wife "Vera" (Sunnyi Melles) before a captain''s dinner that the choppy seas ensure ends in a messy and entertaining disaster! The remainder of their adventure has something of the "Admirable Crichton" to it, as they must adapt to the command of their erstwhile toilet cleaner "Abigail" (Dolly De Leon) who exacts her own unique sort of fees from her erstwhile patrons in return for catching fish and lighting fires... It does take a ping at the vacuousness of the modelling industry and at the unscrupulousness of big business - best exemplified in one scene with Oliver Ford Davies and Amanda Walker as the demure Brits who made their fortune selling "the greatest single contribution to democracy" (hand grenades!). Sadly, though, the moments of humour are relatively short and sweet when put into the context of this lengthy and frequently rather dull enterprise. Dickinson looks great shirtless, but as an actor he has limitations and I didn''t really feel much chemistry between him and, well, anyone else. The last half hour could have been better, funnier, had there been a slight sense of menace - but somehow I just knew that the ending was going to deliver they way it does. Buric adds value, as does Henrik Dorsin''s gazillionaire "Jarmo" but by half way through the joke had worn too thin to sustain it and I was a little bored. Doesn''t need a big screen, and co-produced by the BBC I expect it can wait for Christmas television for most of us.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6201271611386c006a3402f3','garethmb',505026,'Originally set to release in December of 2019; the long-delayed cinematic retelling of Agatha Christieâ€™s â€œDeath on the Nileâ€ has finally arrived in cinemas. The last cinematic version of the classic book arrived in 1978 and this time; Director and star Kenneth Branagh beings his version of Master Detective Hercule Poirot to Egypt after a chance encounter with his friend Bouc (Tom Bateman) while on vacation; Poirot attends the wedding of wealthy socialite Linette Ridgeway (Gal Gadot) and notices that she has married a man named Simon Doyle (Armie Hammer).
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62053742e2bca8009f82f8e1','ChrisSawin',505026,'_Death on the Nile_ crawls towards a resolution you donâ€™t feel invested in. Poirotâ€™s backstory is interesting and there are some solid performances especially from the female cast, but the film otherwise feels like an unwanted game of Guess Who after you unwillingly chug two bottles of NyQuil and are asked to predict who the killer is after two long hours of tediousness.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6208069a9408ec00cc6c61f1','msbreviews',505026,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/death-on-the-nile-spoiler-free-review
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6242011c5a9915004841bea6','Geronimo1967',505026,'It''s probably best to start by saying that this adaptation of the Agatha Christie novel has virtually nothing at all in common with the 1978 Ustinov/Niven iteration (which I really like). Sir Kenneth Branagh starts off by giving us a little of the somewhat tragic WWI backstory to the famous Belgian detective before we are introduced to the newlywed "Doyle" couple Gal Gadot and Armie Hammer, his disgruntled ex girlfriend "Jackie" (Emma Mackey - whom I could have sworn was Margot Robbie) and an assembled cast aboard the luxury Nile paddle steamer "Karnak" where murder and mayhem ensue. A great deal of care has been taken with this production, and it looks great. That said, though, I found the characterisations pretty sterile; there are stars here but not (Annette Bening notwithstanding) big stars, and we get to know little of the personalities or grudges of the suspects. Tom Bateman reprises his role as "Book" from Sir Kenneth''s other, equally flawed, "Poirot" outing back in 2017, but that stretches coincidence just a bit too much! There is little, if any humour, and though I did initially enjoy the 1930s Blues music it started to intrude a bit as the film progressed. Patrick Doyle''s rather bland score reminded me of "Kingdom of Heaven" (2005) and though there is a fair degree of location photography, there is an equally fair degree of pretty obvious CGI too. Somehow, Sir Kenneth just isn''t "Poirot" for me. His performances are always just a little bit too theatrical - he always has to be centre stage. The whole pace of the film really does lack any accumulating sense of menace and though it is certainly better seeing it on a big screen, I was really somewhat underwhelmed.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624a0cbb8c7b0f009a13153b','JPV852',505026,'From a technical standpoint it''s not bad and does feature a good cast and fine performances, but it''s also rather predictable (kind of called the twist early on) and it''s fairly slow to the point it I was losing interest (even though it''s less than two hours long sans credits). Only glad I watched this for free on HBO Max as this was a one-time viewing for me (as was Branagh''s Murder on the Orient Express, which I found only mildly entertaining but also overlong). **2.75/5**');
