INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('63002ad4bb2602008459ec30','mooney240',505026,'**For a movie with death in the title, it takes way too long for the mystery to begin. Bore on the Nile.**
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6309bc35dcb6a30083594a00','JPRetana',505026,'Death on the Nile has a prologue set in World War I, where a young Hercule Poirot is played by a digitally â€˜de-agedâ€™ Kenneth Branagh. Et tu, Kenneth? If you must do this, why not get a younger actor who looks likes Branagh? Or even one who doesnâ€™t look like the Northern Irish writer/director/actor, so long as he looks like an actual human being; itâ€™s safe to say that Branagh looks neither like himself nor like a member of the human race (he actually looks less grotesque after an explosion disfigures one side of his face). Again, this is only if you must do this â€“ but then, you mustnâ€™t do it, especially considering that this prologue exists only, and I kid you not, as an origin story for Poirotâ€™s mustache.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('636de2bdd4653700b44daee9','mooney240',505642,'**Wakanda Forever was an earnest film that tackled some tough themes and honored its hero well but got bogged down introducing vast new worlds and complicated characters.**
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('636e21f0f14dad008399fc36','msbreviews',505642,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/black-panther-wakanda-forever-spoiler-free-review
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6371fb8b6bdec3008a7c105e','Geronimo1967',505642,'Mourning the unexplained death of King "T''Challa", the tech-rich African nation of "Wakanda" returns Queen "Ramonda" (Angela Bassett) to the throne and she must stabilise the kingdom and try to help her daughter "Shuri" (Letitia Wright) deal with the loss of her much-loved brother. A fireside chat late one night doesn''t quite go to plan though, when they are introduced to an interloper. "Namor" (Tenoch Huerta) arrives to ask their help to thwart the Americans who nave managed to design a machine that can trace vibranium, and this has put his hitherto unknown population of underwater, Mesoamerican, people at risk. Either they help him to track down the scientist who created this or there could be war. The Princess and her general head to Massachusetts where they track down a college student who is almost as much of a whizz-kid as "Shuri". The FBI are on soon their trail and skedaddle they must, straight into the arms of the waiting "Talokan" who take them to their beautiful watery homeland where we learn just how they evolved. Somewhat narked, the Queen wants her daughter back and that action sows the seeds for a conflict between the two nations that, well, you can guess the rest. Sadly, that''s the problem here. Despite a really strong and vibrant performance from Wright and some very fine production values, there is precious little story here. It is far, far, too long to sustain the thin plot and the conflict engineered between the two races is flawed in more ways than an US Congressional election. The pace is really slow, the combat scenes could have been choreographed by Sir Matthew Bourne - or by a Wakandan cheerleader at their equivalent of the "Superbowl" - and the supporting characters aren''t on screen long enough to give Miss Wright enough help to wade through the frequent tedium. I wasn''t helped by Huerta''s very thick accent which made his dialogue nigh-on impossible to comprehend at times and the denouement screamed sequel so loudly that I forgot that I''d long given up on any jeopardy at the end two hours ago. There is a bit of character tragedy, character loyalty and thankfully Martin Freeman''s ("Ross" - why does he need an American accent?) appears but sparingly as we go along but Marvel must stop taking the audience for granted. They have to realise that their gorgeous Avatar-esque visual effects and technical wizardry are not going to entertain us indefinitely if the stories continue to deliver so weakly. Great to look at, a few power-ballads from the soundtrack and Wright is certainly a stylish and classy star - otherwise, this is a film nobody will remember in two years time, I''ll bet!');
