INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624ac1c28c7b0f004e5be7a8','Geronimo1967',508947,'This has quite a fun premiss but I guess I''m just the wrong demographic because I really struggled to get through it. "Meilin" is a thirteen year old girl going through the usual teenage angst sort of stuff - only, when she gets agitated she morphs into a giant panda. A red one. Her mother "Ming" is a bit over-protective and when her daughter announces that she wants to go and see a boy-band concert with her friends, a war of wills ensues. It soon turns out that these transformation skills run in the family, and huge great angry pandas are not to be messed with. The animation is fine and Eilish/O''Connell have written some fitting, if hardly their most memorable, numbers, but it is just too long and the theme recycles itself once too often for my old eyes. Colourful enough, but for me it just re-emphasised why I am very, very, glad I am no longer 13! (or even 31!)');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6303b50ce8601700818e34bf','TitanGusang',520023,'I can''t say I am a bit disappointed about this film, I can''t really say that there was one thing in particular that I did not enjoy, it just didn''t work for me as much as I would have liked. The plot line was fairly predictable, even with the twists and turns. Characters consistently make stupid decisions for plot''s sake, even though that is the M.O. for slasher films, I expected a bit more from A24. The slasher elements were barely present, even though I knew that coming in, the marketing still makes this look like a different movie altogether. The comedy was lackluster, I understand it was suppose to be dry social commentary based humor, but I did not really find it funny one bit. Even with all my critiques, I still found this movie somewhat enjoyable.
