INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62bf89f822e4800497197f01','ChrisSawin',522927,'_The Forgiven_ is a peculiar film that seems to be trying to say something about poverty or the wealthy being blind to anything that isnâ€™t directly under their noses, but it also squeezes in a few jabs at racism. The whole thing about throwing mice off of rooftops while wearing parachutes with swastikas on them is really bizarre. The film alludes to death and uncertainty at every turn with verbal descriptions of torture and a brief clip of Hershelâ€™s beheading on The Walking Dead. Despite the best efforts of a massively talented cast, _The Forgiven_ trudges around in circles to the point where you donâ€™t care what its destination is as long as it finally and truly ends.
