INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('631c86ad0d2f53007c6b6a9c','ChrisSawin',532639,'_Pinocchio_ has been begrudgingly transformed from a flawed animated masterpiece into this shiny, superfluous turd of a live-action film. The majority of the classic characters have been mangled in some capacity while new characters are lame fluff serving as more of insurmountable obstacles youâ€™re forced to endure rather than offering any sort of entertainment value or overall purpose to the actual story. With tangled strings and meandering storytelling, _Pinocchio_ is a musical misfire that attempts to annihilate everything that made its animated counterpart so enjoyable. 
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62936dfefd630000663ab0b2','Geronimo1967',532710,'He might look good in a white T-shirt but the thing is, as Zac Efron gets older he looks more and more like an automaton. When he was younger, he had a charm about him - now he just looks like his life consists of nothing but the gym, the manscapists and a bath in yesterday''s excess kale smoothie mix! Add to that really lacklustre performance some screaming from a competent youngster in Ryan Kiera Armstrong ("Charlie") and we are left with a very mediocre adaptation of this pretty lightweight Stephen King story that is big on pyrotechnic effects, certainly, but on very little else. There is a story: the youngster can cause things to combust at will when she gets stressed or annoyed; her father can bend people to his will making his eyes bleed in the process - quite an effective cure for smokers who want to give up; and her mother - Sidney Lemmon, well she too has a quirk - but I cannot remember what it was (but it definitely wasn''t firefighting). Anyway, those who scientifically enhanced this family are hot on their trail - and it''s all a question of who will prevail. Well it would be if you were still remotely bothered but after half an hour I just wasn''t. For a movie about conflagration - it''s sadly all a bit of a damp squib.');
