INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('61f80e90b6abc400f036e82b','abdullahosmn',585378,'I found in After Yang something I had been searching for for a long time. It is particularly special to me as an Asian whose culture and sense of belonging has faded with each passing generation. My recent quest to rekindle what was once of my ancestors has been especially difficult in a climate that has so flagrantly looked down upon me. After Yang provides a sense of relief in the idea that who you are is not solely defined by where you come from.
