INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('637b437d976e4800b4563113','Geronimo1967',593643,'Arch-foodie "Tyler" (Nicholas Hoult) and his girlfriend "Margot" (Anya Taylor-Joy) are off to dine in a restaurant without parallel. Based on an island of just twelve acres, they join a collection of wealthy and influential people for what has been defined as experience to die for! Upon arrival, we discover that "Margot" was not the originally intended guest of her companion - so first question... Who is she? Next question - why does it seem to matter so much to the fastidious and frankly rather menacing chef "Slowik" (Ralph Fiennes) and his assistant "Elsa" (Hong Chau) who looks like she used "Rosa Klebb" as a role model? As the dinner progresses it becomes quite clear that the menu is not just about the exquisitely prepared and presented food, but is also about an appraisal of the individually selected - and none too savoury - staff and clientele, none of who are quite what they seem! This has something of Agatha Christie''s "Ten Little Indians" to it, and it quite effectively pokes fun at the supercilious and frequently rather pompous attitude of both those cooking and those eating (or experiencing) fine foam dining. That humour is dark and potent, too. Fiennes is entirely convincing and Hoult, as well as Janet McTeer as the self-important food critic "Lillian" and Paul Adelstein as her suitably obsequious companion "Ted" contribute well as the sense of the ridiculous evolves into one considerably more perilous. It could have evolved just a bit more quickly for me - there are certainly enough "get on with it" moments and though ATJ''s character is feisty, it doesn''t quite work and ultimately served to illustrate the increasing implausibility of the story and unlikely servility of the diners as we head towards an almost Vernean denouement. It is quirkily entertaining this - a well presented, multi-layered, attack on our own senses that is better second time around. Not perfect, but I suspect Michelin would love it.');
