INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b8deb0a61de103b56957b7','Geronimo1967',614934,'After about ten minutes, I was both exhausted and terrified. Was what I had just seen - colourful but frenetic and haphazard going to continue? Well, it does calm down - and continues to quite cleverly interweave the early years and aspirations of this young boy with the openly racist political situation that prevailed in the Southern United States in the early 1940s. From here on in, I am treating this as a provocative and entertaining but entirely speculative drama about this man. Historians always argue about what did happen - or what might have, and I haven''t any factual insight to add. On that basis, this is a quickly paced and creatively structured depiction of the main points of the life of Elvis. Austin Butler has an uncanny resemblance. As was often said of Dustin Hoffman, it''s a fine line between mimicry and acting, but here I think Butler is more in the latter corner. He puts enormous effort into this portrayal. Physically and emotionally he gives convincingly of his all, leaving us in no doubt as to the talents and raw charisma that drove Presley to sell more records than anyone else. History tells us that he was discovered, and that until his death he had a pretty turbulent relationship with his promoter - Col. Tom Parker (Tom Hanks). Hanks is fine, no better. His make up did distract me, especially as he aged, and his accent isn''t the best; but he features surprisingly sparingly even if he is essentially relaying the narrative to us. Virtually all of this focusses on the excellent Butler as he demonstrates the highs and low of this man who ended up craving love and adulation as readily as anyone can crave drugs or booze (though he used his fair share of them too). I could have done with more flesh on the bones of his relationship with his mother and his wife, but the depictions of the parasitic hangers-on who continually bleed him dry leave us with a potent image of a not unintelligent man who brought pleasure to millions with his gyrating, his songs and his personality, but maybe didn''t keep that much back for himself. It''s planet Baz, so of course it is flamboyant and busy, the musical numbers are fluid and full of energy. Once it settles down it is a vibrant and lively effort that really does fly by and that I really did enjoy.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('634db91212eb890082c55beb','msbreviews',614939,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/bros-spoiler-free-review-lff-2022
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6351d340a894d6007a0f39f6','Geronimo1967',614939,'As a man who really struggles with romcoms at the best of times, I was rather nervous about this. Actually, though, it steers clear of some (though not all) of the gay stereotypes and presents us with a genuinely quite funny love story about two forty-somethings who meet in a nightclub. One, "Bobby" (Billy Eichner) is a ordinary looking, gobby podcaster and activist who is trying to raise the money needed for an American National LGBTQ+ museum. The other is "Aaron" (Luke Macfarlane) - a lawyer who spends a fair amount of time on the cross-fit. They wouldn''t appear to be the most natural of fits but a series of brief encounters on their opening night coupled with a fair degree of sarcasm and a kiss sets the tone for what happens next. Certainly, anyone who has a Dekkoo subscription will have seen the format before - and often, and this doesn''t really vary the theme much. What does make this different is the characters have much more depth. Their relationship is never going to be straightforward and though sometimes delivered via annoyingly angry monologues, the character of "Bobby" makes some fairly profound and well reasoned arguments about the constraints history has imposed on people of differing sexualities over the years. Eichner is effective as a man who uses his sharp and pithy tongue to prove the best form of defence is attack, Macfarlane proves to be far more than the man with the muscle, and the writing from the former and director Nicholas Stoller clearly demonstrates that both men have skin in this particular game. Experience has clearly informed and fuelled this creative process. It can be a bit hit or miss, especially the third quarter when it all becomes a bit contrived, but the ending redeems it rather - if only for the pure schmaltz of the serenade - and I rather enjoyed it. It sure doesn''t need a cinema screening, but it is entertainingly provocative at times. The BBFC slide at the top warned of "strong sex". Clearly they have never watched "Theo and Hugo" (2016) because there is nothing at all visual in this that could conceivably cause offence; even the language is comparatively mild.');
