INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62bf3c609672ed004e7efb96','TitanGusang',615469,'Going into Spiderhead I was not expecting much due to the mixed bag of reviews, but I was really surprised. The concept is really interesting and very deranged, I found myself gasping out loud at scenarios that were presented to the inmates throughout the film. While I do agree that the third act does fall bit short, I still found it enjoyable enough. The acting in this movie was superb. Chris Hemsworth does an excellent job as the "villain," he really makes you believe that he is doing this out of a good heart. It was really nice seeing him play a somewhat demented scientist, which is outside of the comedic role that he has carved himself due to the MCU. Wyatt Teller and Jurnee Smollett do a really good job as well, they have very emotionally invested scenes that bleed over to the audience. Overall, this film starts off strong and slowly fades towards the end but nothing that tremendously hurts the overall product.
