INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62c9df1064de350050dfdb1f','TitanGusang',616037,'After a rocky start, _Thor Love and Thunder_ is able to find its footing during delivering a fun and despondent Thor adventure filled with a tremendous amount of heart.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ca8c62e8131d068b119bf7','steveinadelaide l',616037,'**Thor: Love and Thunder** is a sequel to the 2017 film Thor: Ragnarok. It is written and directed by Taika Waititi and based on, of course, the Marvel Comics by Stan Lee. The film stars Chris Hemsworth as Thor, Natalie Portman as Jane Foster / Mighty Thor, and Christian Bale as Gorr the God Butcher.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62cc827fe8d0280052f1c8e1','Geronimo1967',616037,'This was my favourite of the Marvel franchises, but boy have we now plumbed the depths. Taika Waititi presents us here with a mess of a film that dumps just about all of the original exciting Norse mythology and legend, and substitutes it with something little better than a cartoon. Chris Hemsworth does try quite hard, and nobody could ever doubt Christian Bale''s commitment to his roles - he must have lost half his bodyweight as he portrays the emaciated "Gorr". This poor fellow loses his daughter but has hopes that his local god will step in. Nope, as Jordan Peele might have said, and as the evil necro-sword mysteriously appears in his hand, he duly dispatches this thoughtless immortal and thereby vows to do the same for all the rest. When several Asgardian children are kidnapped and taken to the shadowland, it falls to Thor, "King Valkyrie" (Tessa Thompson) and the newly empowered - but terminally ill - "Jane" (Natalie Portman) to thwart this plan. Along the way, they try to recruit some other gods from different pantheons - notably Zeus (a hammily absurd Russell Crowe) but ultimately it''s all down to these three to save the day. There is a bit of humour at the start - and maybe Jane Fonda would have been an useful addition, but for the most part this film is neither one thing nor another with too much romance - a serious illness that just didn''t belong in a light-heated fantasy film that treats death as an occupational hazard for the characters; and the need to generate and sustain the supporting characters reduced the impact of Thor to little more than a team player in a red cape. The ending is weak, but frankly no more so than most of the rest of this truly disappointing feature. If you stick right to the end of the credits, you will see that perhaps Hercules is to be the next topic for this character - I can only hope Sir Kenneth Branagh is available. Looks great on a big screen, superb visual effects etc., but Marvel have lost their way with this...');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ce1450e62719004cabaaae','ChrisSawin',616037,'To be fair, Waititi has some really funny material in _Love and Thunder_. Everyone in the extremely talented cast looks to be having a ton of fun and the villain is out of this world good. The events of the film feel kind of pointless, especially with repeat viewings. Phase four of the MCU has this aimless direction that is heading towards a ton of projects that no one is really all that excited for. After Endgame and Spider-Man: No Way Home, it honestly feels like the MCU has reached its peak. _Thor: Love and Thunder_ is mostly just a brightly colored filler episode that will likely be forgotten about like most of the _Thor_ franchise.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6349a612b7abb50081e7f296','TitanGusang',616820,'_Halloween Ends_ is such a weird film, as a standalone movie I enjoyed it but in the trilogies totality it underwhelms and undermines. With each entry in this trilogy, the movies get farther and farther away from what Halloween is. With Ends there is no tension and no horror, there are some good kills but with nothing building up to it they felt stale. This movie also tears down Michael Meyers in a way that felt out of place in the trilogy. Halloween Kills built Michael up to be an indestructible force with the ability to withstand fire or multiple gunshot wounds, but in Ends that is flipped on its head making him weak due to the ending of the predecessor. It left me feeling like the writers had no idea what they were doing in developing this trilogy. The marketing of the movie was a total farce as well. It was building up to a final clash between Laurie and Michael, and while that does happen the majority follows a character that was just introduced (Corey Cunningham). Even though I really like the opening sequence and backstory to Corey, it had no place being centerstage in the final installment. Overall, this movie was slightly better than the sequel but still squanders the potential that Halloween (2018) had for the trilogy. If any more movies or trilogies are made in the future, please for the love of God hire a producer/writer to develop the entire series instead of piecing it together film by film.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('634aed83c8a2d4007a2fdaee','mooney240',616820,'**Poor writing and a confusing story overshadowed a few shining moments and satisfying conclusions to character stories.**
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('634ba83220e6a5007a6a3943','MovieGuys',616820,'An unfortunate end, to a horror franchise, that started way back in 1978. 
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('634bc2ebc175b2007f8119bd','TwiceONCE2016',616820,'It''s a sad state of affairs when HALLOWEEN ENDS (2022) is being classed as a "bad", "terrible" or "disgraceful" motion picture and I worry for cinema as a whole if the only direction the mass want is nothing but cookie-cutter.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('634f4e13076ce8007a50f716','ChrisSawin',616820,'_Halloween Ends_ does provide what it promises and thatâ€™s a proper end to the Laurie Strode saga. However, the birth of a new rushed, hot-headed, and sloppier version of The Shape seems to take precedence only to be squashed before Laurie and Michael meet one last time. Entertaining at times and frustrating at others, _Halloween Ends_ is a bloody scenic route of a conclusion that is mostly satisfying despite its underappreciated albeit risky detours.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('63511d36076ce8007a51b6bf','Geronimo1967',616820,'Well there is a hewn-out pumpkin that looks ever so slightly scary... Otherwise, this is just one "Halloween" movie too many and it''s only scream yells "put me out of my misery" pretty much from the start of this slow and plodding denouement to the franchise. Rohan Campbell ("Corey") is bullied by some kids who end up shoving him from a bridge. He is dragged into the storm drains by you know who and emerges a man possessed. He has also attached himself to "Allyson" (Andi Matichak) who just happens to be the daughter of long suffering "Laurie" (Jamie Lee Curtis) and after a bit of hysteric family melodrama, all of her demons are flee-flowing and we are heading, slowly and ponderously to a conclusion that the best of which has already been seen many times in the trailers. This is far too long, virtually nothing happens until the last fifteen minutes and even then, there isn''t even the vaguest hint of menace or jeopardy. The production is adequate, but JLC doesn''t really feature often enough - as in "Halloween Kills" (2021) to make much impact - and the whole thing is episodic and smacks of made for television. Please let it be the final instalment - this bears no resemblance whatsoever to the original 1978 introduction to "Myers" et al.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('63560465d6c300007ddb6e2b','JPV852',616820,'Okay, seriously, when is the real "Halloween Ends" be released? What I saw for the bulk was some lame CW-like story. I have to think at this point David Gordon Green and the writer crew are just pulling a prank. I half expected a post-credit scene with Impractical Jokers...
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('633159ecd38b580092a8ca25','Geronimo1967',619730,'So imagine the scenario. A boozy lunch with with some screenwriters who had just seen "Vivarium" (2019) and began to recall "Stepford Wives" (2004) and the "Truman Show" (1998). We know, say the assembled talent - let''s write a pointless hybrid of these stories, making sure to avoid the best bits of any of them then get two gorgeous people to take part. We''ll end up minted! Well they may well have ended up making loads of cash, but what they have provided for us is an heavily stylised story that goes nowhere fast. To be fair, Florence Pugh tries quite hard as "Alice", the increasingly disturbed wife of "Jack" (Harry Styles). They live in an Utopian desert community where the men all head to work for "Frank" (Chris Pine) in the morning and the women do the standard middle class housework, shopping and networking things. All is idyllic until "Alice" notices that one of their neighbours "Margaret" (KiKi Layne) is convinced that something is amiss amidst their perfect lifestyle. When an inexplicable tragedy ensues, "Alice" starts to have nightmares and soon her marriage and his career prospects are in jeopardy. Pine isn''t the least menacing as the duplicitous "Frank" and though the camera really does love Styles, he has little here to demonstrate whether he can actually act or can just fill a perfectly tailored suit as well as Daniel Craig. That''s really the problem here. The film looks good, but the plot is completely undercooked. We are delivered of a partially formed plot that is derivative and, frankly, rather dull. The last few scenes with the guys in red reminded me of a television commercial for Vodaphone and at just over two hours long, I was just unengaged with it all. Styles'' looks will take him far and working with the likes of Pugh and Pine will only help him, but unless his people work harder on the scripts and characterisations, then he will just end up Zac Efron-light. This is a film for television in due course, I''d say.');
