INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6349a4a1414291009882333b','TitanGusang',619730,'It is no surprise that _Don''t Worry Darling_ has been marred with public controversies and poor critic reception, but is it really bad as the media would want you to believe? While I admit, there are plenty of issues in the story department, like completely abandoning certain plot details as they are introduced or leaving certain character plots half-baked to name a few, the other aspects of this film really make this an enjoyable viewing experience.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62d75678cb71b80071d7153d','ChrisSawin',619803,'Since _The Roundup_ is a South Korean film, it feels like itâ€™s able to break away from whatever expectations you may have for an American made action blockbuster. It may be an action and a crime film, but it also adds elements of drama and is borderline horror at times with how extreme some of the action sequences are. Don Lee has undeniable magnetic charisma and is overflowing with unbelievable talent. Heâ€™s a certified, bone-breaking megastar. _The Roundup_ is a savagely captivating action extravaganza with lightning fast action and brilliant performances. 
