INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('630acc9ec39266008287c2ce','JPRetana',628878,'The difference between Mel Gibsonâ€™s and Bruce Willisâ€™s recent losing streaks is dignity. And I donâ€™t mean the comparatively more dignified air that a slightly bigger budget confers upon Gibsonâ€™s latest as opposed to Willisâ€™s (if the formerâ€™s are made on a shoestring, the latterâ€™s bring to mind a loafer). My point is that, while Willis is dragged down by the material, Gibson elevates it â€“ at least as far as his character is concerned; the overall outcome tends to be less than the sum of its parts, but the fact remains that Gibsonâ€™s part is usually the best, if not the only good thing about the movie (case in point, his turn as an alcoholic actor who runs afoul of the law in Last Looks shows a healthy willingness to satirize his own public image).
