INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6211317c44a4240046c79861','ChrisSawin',632727,'The problem now is that the successful film formula revolves around nostalgia, rehashing familiar sequences and storylines, and bringing back survivors for one final confrontation. This has all proven to crush the box office, especially during the pandemic. This results in there being no originality or creativity anymore; itâ€™s just a repetition of what weâ€™ve already seen. Until Leatherface can get a fresh face to wear, the _Texas Chainsaw Massacre_ franchise is doomed to run in circles with a sputtering chainsaw on a mostly deserted road no one wants to travel down.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ae81ff7f1d830061e2f429','wrongellison',632727,'Texas Chainsaw Massacre (2022) is a film I was looking forward to for a while, although I wasn''t sure why. I had been very disappointed in the last couple additions to the TCM franchise, so I knew it was very likely that it would not be any different with this one. I watched the film the day it came out, and received exactly what I expected, I didn''t like it. I liked it more than I expected, yes, but still not enough. The acting was lacking, the premise was stupid, and it killed off the beloved legacy character in the most insulting way possible. The only redeeming aspects of the movie are the nice-looking cinematography and the amazing gore. However, I am looking forward to seeing the next one, and I have no idea why. 3.5/5.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('630b01913dd126007b2eb5a3','JPRetana',632727,'The original The Texas Chainsaw Massacre actually predated the original Halloween by four years, but now itâ€™s the formerâ€™s turn to follow in the footsteps of the latter, resulting in a case of the blind leading the blind. This new Texas Chainsaw Massacre takes its cues from the recent Halloween and Halloween Kills, going as far as dusting off the franchiseâ€™s original Final Girl â€“ the character, that is; Marilyn Burns, the actress who played the first Sally Hardesty, died in 2014, and she certainly is in a better place now (i.e., not in this movie).
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('637e2f3d75f1ad00df595b47','Geronimo1967',632856,'Wow, but this is all over the place. Based very loosely on the Dickens'' character from his "A Christmas Carol" story, Will Ferrell is the Ghost of Christmas Present who now works for "Jacob Marley" (Patrick Page) trying to save irredeemable souls from purgatory. This is where Ryan Reynolds comes in. He is "Clint" - a successful influencer who is about as ruthless for his clients as it possible to be. "Present" concludes that if he can save him, then he can make a real difference to the future (despite the fact that he appears, already, to have rescued Dolly Parton!). Anyway, this is where the story gets a little more interesting. Rather than cowering in fear at his apparitions, "Clint" decides to turn the tables a bit and before we know it, he is challenging his protagonist to justify what he is doing and why. Unfortunately, though - and despite the presence of the usually reliable Octavia Spencer - the whole thing just peters out all too quickly with some predictably slapstick humour and a few rather dull piano/guitar ballads from an out-of-sorts Messrs. Pasek and Paul that have some potent lyrics now and again, but those are largely overwhelmed by the fact that Reynolds cannot sing and Ferrell fares only slightly better on that front too. It also has no idea how to end, so it has three or four goes by which time I was a bit bored by it all. It''s been quite a while since I noticed people leaving a cinema screening, but quite a few abandoned this. Nothing beats the Albert Finney/Leslie Bricusse "Scrooge" (1970) for me, and though this iteration of the timeless story might work better on stage - much of it is very theatrically stylised in nature (especially the dance numbers) - I am just going to stick with that.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6328259320af77007bfce2e6','Geronimo1967',635891,'It''s quite fun to try and spot the famous names who pepper this otherwise puerile and really rather unfunny film - but that was about it for me. It''s all about a "Dante" (Brian O''Halloran) and "Elias" (Trevor Fehrman) who run a small-town store. They spend much of their day quoting lines from their favourite films until poor old "Elias" has an heart attack. Whisked to hospital, his friends decide to make a film about life in their convenience store. What now ensues may well offer us an isight into just how a sudden medical emergency can focus the attention and motivate people, but I just found the references either too in-your-face or absurdly obscure and contrived. Perhaps this will rate better in the USA, but here in the UK this just comes across as a rather sad indictment of rural life where it''s all about weed and dumb wheezes. It is extremely difficult to marry the threads of humour and tragedy. Dark humour, in my view, is the hardest to write and play well - and I am afraid that nobody here really carries it off with much distinction. Maybe I just wasn''t in the mood, but I didn''t hear anyone else in the cinema laughing either. Not for me, sorry.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('625d3ba5229ae2321982ffcc','Geronimo1967',639933,'First things first - there is virtually nothing original with the plot here. A young prince "Amleth" (Oscar Novak who later morphs into an effective Alexander SkarsgÃ¥rd) witnesses the murder of his father "King Aurvandil" (Ethan Hawke) and the capture of his mother "GudrÃºn" (Nicole Kidman) by his treacherous uncle "FjÃ¶lnir" (Claes Bang). Lucky to escape with his life, he escapes to the land of the Rus where he is soon a capable and powerful warrior. When he learns that the traitor was, himself, deposed and now lives in the inhospitable Iceland, he decides to impersonate one of a group of slaves being sent to his farm so as to wreak his revenge. There are a few twists to the otherwise largely predictable plot - he meets the enigmatic "Olga" (Anya Taylor-Joy) and comes into possession of a deadly sword that can only be drawn at night; but what really makes this stand out is the gritty, dark and enthralling production. The headlines actors actually feature pretty sparingly, though we get a little more Kidman towards the end, and that''s no bad thing. It leaves us to enjoy a storyline that draws heavily on the compelling Norse mythology. Not just of Odin, Freya, Valhallah and the like, but of the whole cult of nature; of animalistic behaviour amongst man and beast alike. It draws on a symbiotic relationship with the environment that tests the faith of pagan and Christian alike. It is brutal, but somehow not gratuitous. That''s how man treated man; women were little better than breeding chattels and children were even further down the food chain. Robert Eggers has put much more meat on the bones than almost any similar depiction from this hugely rich and enthralling vein of mythology that mixes fact, fiction, fantasy, mysticism and fear very well. It''s 2Â¼ of well paced adventure that looks stunning on a big screen and is well worth a watch there before it loses much of it''s grand scale potency on a telly.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('636d28371684f700c4e9fb7b','Geronimo1967',642885,'Whilst this isn''t really a patch on the first outing for the "Sanderson" sisters, it''s still quite a decent sequel that manages to reassemble Bette Midler, Sarah Jessica Parker and Kathy Najimy for some evil witchery. This time around it is 16th birthday girl "Becca" (Whitney Peak) and her best friend "Izzy" (Belinda Escobedo) who inadvertently disturb the witches using a magic candle. Needless to say, our tricky trio are ravenous for children to eat and are seeking a little bit of revenge too! It takes a bit too long for the the Divine Miss M and company to take to the screen, before that this is a rather muddled teenage affair, but once they are in full swing it is quite good fun with plenty of faux malevolence from "Winifred" and some mischief from her sisters once they discover that they, too, can zap folks. Ultimately, even the book of spells gets to choose it''s own destiny - but whom will it follow? Star of the film is definitely "Billy Butcherson" - or his disembodied head, and a lively reversion of Blondie''s "One Way or Another" gets the toes tapping away nicely too. This is an enjoyable family film that does what it sets out to do - entertain all in a gently, engaging and entirely forgettable fashion.');
