INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('61f5675e37b3a9006c515a46','ChrisSawin',646385,'Ghostface is my favorite cinematic serial killer and I love the first four films (yes, even _Scream 3_ and Galeâ€™s terrible bangs) despite their flaws and fluctuating factors of entertainment. Iâ€™ll see and support any new _Scream_ film or TV series that comes along because of it. I know this new installment was successful ($88.4 million worldwide box office gross as of this writing) and some enjoyed it, but it is honestly my least favorite in the franchise.
