INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624b001615a4a100a0a8ca82','Geronimo1967',647808,'I fully expected to hate this film, but actually although it is an one joke movie, Catherine Tate in the title role and her grandson sidekick Mathew Horne ("Jamie") have quite a bit of a lark as they travel to the island off the island of Ireland to visit her long estranged sister "Nell" (Katherine Parkinson). We discover just why they fell out and watch just how this gregarious old woman poo-poos just about every modern day, politically correct, convention as she swears and farts her way around the country. Horne is a reasonable foil for her, but this is really just an one-hander with a star who lives and breathes this character and despite myself, it did raise the odd smile. Laugh out loud? Well it was for some in the cinema and there are quite a few fun escapades packed into the 90-odd minutes it lasts. It is not, I would say, a cinema film - it will look fine on the telly at Christmas. Not great, indeed it''s puerile at times, but it''s not dreadful either.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6264c4816eecee30f2cef968','ChrisSawin',648579,'It certainly seems like _The Unbearable Weight of Massive Talent_ will have a deeper impact on you if youâ€™re at least somewhat of a fan of Nicolas Cageâ€™s work, but could also be amusing for fans of absurd adult comedies. Pedro Pascal is the humorous wingman we all wish we could have; soft-spoken and yet a priceless factor in the overall ludicrous nature of the film. Meanwhile, Nicolas Cage continues to reign supreme as a talented lunatic at the top of his game. _The Unbearable Weight of Massive Talent_ is an outrageous and uproarious expedition into hilarity and absurdity. Nicolas Cage and Pedro Pascal are an unlikely yet brilliant comical duo that will have you rolling on the sticky movie theater floor with laughter.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6267a4ff1967570067a37d8d','Geronimo1967',648579,'No-one could ever accuse Nicolas Cage of not having a sense of humour. He plays himself for most of this, depicting a somewhat fallen star whose agent (Neil Patrick Harris) finds him a gig for $1m to go to the birthday party of his wealthy Mallorcan superman "Javi" (Pedro Pascal). Lack of options force him to travel and he quite quickly befriends his adulatory, spring screenplay writer, amigo. Snag - well Tiffany Haddish ("Vivan") is the CIA on the island, and she tries to co-opt him onto a cunning plan to trap "Javi" - whom she believes to be a criminal kingpin behind the kidnap of the daughter of a politician. What now ensue are some quite fun escapades as the actor has to turn his hand to skills he would do off pat if he were in front of a camera, but not so readily in "real life" - and it turns out that he isn''t half bad, either. Is "Javi" really the baddie? Will Cage rise to the challenge? All is revealed in this amiable parody of not just many of his own films, but of espionage and action drama in general. It''s got some car chases, fancy locations, power boats and a room with a waxwork that would not have looked out of place with Peter Cushing and Christopher Lee. A bit ripe at times, the dialogue is peppered with plenty of wittiness and Cage plays the exasperated, then terrified, then motivated actor with aplomb and with his tongue in his cheek. Pascal makes for a fun foil keeping the bromance bubbling along nicely, and with Sharon Horgan delivering well as his long-suffering ex-wife ("Olivia") this is a well paced and enjoyable adventure romp.');
