INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('635669bbc9dbf9008238412d','Geronimo1967',674324,'I really did enjoy this film, but I can''t say I am entirely sure what the point of it was...! Colin Farrell is "PÃ¡draic", a man who routinely spends his days down the pub with his friend "Colm" (Brendan Gleeson) before returning home to their small dairy farm where he lives with his itchy-footed sister "Siobhan" (Kerry Condon). Out of the blue one day, his pal refuses to talk to him. He goes and sits elsewhere or outside their tiny pub. Nobody knows why. Confronting this head on, we discover that "PÃ¡draic" is dull. He spends hours droning on about the contents of his donkey''s manure and, well, poor old "Colm" has had enough. Indeed, so fed up is he, he swears to cut off one of his fingers - from his fiddle-playing hand - if his erstwhile buddy doesn''t leave him alone. The consequences of this ostensibly trivial falling out soon spiral and that, to be fair, is where it stopped being a funny take on friendship and Irish rural life, and starts to become a bit darker and where I sort of got lost with the purpose (if there was one) or meaning of the tale. Meantime, the real star of the film - aside from the midget-donkey - is Barry Keoghan with his superbly honest portrayal of "Dominic". An outwardly simple lad who lives with his thuggish, policeman, father; who has the hots for "Siobhan"; a penchant for poteen and who provides much of the humour in this entertaining and quirky observational drama. The photography of this Irish island community is glorious and the sense of community - warts and all - is well captured by Martin McDonagh''s pithy writing and simple direction. The two stars are on as good a form as I have ever seen them, with Gleeson using his sparing dialogue to full effect and Farrell conveying the evolving sensations of bemusement to anger convincingly too. It''s a curious film, this, but I''d highly recommend it.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624abbe2d9f4a60063674455','Geronimo1967',675353,'Never saw the first one, nor played any of the games - but I still quite enjoyed this animated adventure. "Sonic" is determined to use his powers to be a crime fighting hero, but frequently causes more havoc than the criminals! When the dastardly "Robotnik" manages to escape from his prison in a galaxy far, far, way and returns with the echidna from hell ("Knuckles") though, our blue pal finds himself and his family in considerable peril. Luckily, help is on hand from the twin-tailed "Tails" and battle lines are drawn Who can find the giant emerald first? The story is pretty derivative - bits of "Indiana Jones"; "National Treasure" and even "Guardians of the Galaxy" all seem to have influenced the story, which I have to say is a little predictably thin. That said, it is well placed with plenty in the script for the grown ups amongst the audience. "Sonic" makes for quite a likeable rodent and Jim Carrey"s engagingly hammy, moustachioed, megalomanic works well. The star? Well that''s Natasha Rothwell''s no-nonsense, would-be bride "Rachel" (a part of the storyline that doesn''t work so well, but she is definitely not to be messed with). The visual effects are impressive and though maybe fifteen minutes too long, I still found it very much better than I had expected.');
