INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6250e3cc383df20fcb7aaa14','ChrisSawin',675353,'Sonic the Hedgehog 2 embraces the nostalgia of Sega Genesis and the essence of the 90s with a film that is fun for absolutely everyone of all ages. Audiences will adore the new characters, the action is a memorable throwback to what we loved about the games the films are based on, and the special effects are top notch. Even with its flaws, Sonic the Hedgehog 2 is the best video game adaptation ever.
