INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('635f084541eee10091179767','Geronimo1967',676547,'Jacqueline Byers is "Sister Ann" - a troubled young nun whose relationship with her late, clinically diagnosed schizophrenic, mother has left her determined to take holy orders and to help other people with mental health disorders. She has a nursing position at a church hospital where the Catholic church - under the leadership "Fr. Quinn" (Colin Salmon) and psychiatrist "Dr. Peters" (Virginia Madsen) use scientific and ecclesiastic methods to treat their patients. The former leads their exorcism training regime and it to that that the nun is drawn. Her skills are initially tested when she has to try and deal with the apparent possession of the young "Natalie" (Posy Taylor) but that operation merely serves to open up an entire wardrobe of demons - including some very close to home for "Ann". Actually, the story here is not half bad - but the acting and the whole presentation of the film is seriously lacklustre. Sure, there are a few quite effective jump moments but as the story gathers pace it loses any semblance of plausibility. The writing clumsily muddles scripture and vernacular and the ending is really old hat. It has the ring of an over-stretched short story to it. It might almost have made for a decent "Tales of the Unexpected" forty-five minute television drama rather than dragging it out with loads of establishing shots of the rather nice building she works in and rain, lots and lots of rain! Saw it tonight in 100-seat cinema all by myself - I can''t say I am surprised - this is really all rather poor.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('635f084895c0af007f826b83','Geronimo1967',676547,'Jacqueline Byers is "Sister Ann" - a troubled young nun whose relationship with her late, clinically diagnosed schizophrenic, mother has left her determined to take holy orders and to help other people with mental health disorders. She has a nursing position at a church hospital where the Catholic church - under the leadership "Fr. Quinn" (Colin Salmon) and psychiatrist "Dr. Peters" (Virginia Madsen) use scientific and ecclesiastic methods to treat their patients. The former leads their exorcism training regime and it to that that the nun is drawn. Her skills are initially tested when she has to try and deal with the apparent possession of the young "Natalie" (Posy Taylor) but that operation merely serves to open up an entire wardrobe of demons - including some very close to home for "Ann". Actually, the story here is not half bad - but the acting and the whole presentation of the film is seriously lacklustre. Sure, there are a few quite effective jump moments but as the story gathers pace it loses any semblance of plausibility. The writing clumsily muddles scripture and vernacular and the ending is really old hat. It has the ring of an over-stretched short story to it. It might almost have made for a decent "Tales of the Unexpected" forty-five minute television drama rather than dragging it out with loads of establishing shots of the rather nice building she works in and rain, lots and lots of rain! Saw it tonight in a 100-seat cinema all by myself - I can''t say I am surprised - this is really all rather poor.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('63259826511d090098536bed','Geronimo1967',676701,'Whilst excavating a tomb in South America, would-be archaeologist "Tad" discovers the most unlikely of objects - an Egyptian mummy. Derided by his rather academic colleagues, he is sent back to Chicago where his apartment is full of treasures that he has been obliged to keep under wraps - one such antiquity being an enthusiastically alive Aztec mummy called, well quite aptly - "Mummy". When his erstwhile colleagues discover this sarcophagus and return it to America, he - armed with what he thinks is a key, and assisted by his friend "Sara" manages to get into the museum, open the coffin and release.... Soon all human life is at risk, and they must race to obtain the sacred emerald tablet that will fulfil the dearest wish of it''s owner - for good or ill! It''s derivative. Yes. Loads of "Indiana Jones" style scenarios with bits of Brendan Fraser''s "Mummy" thrown in too. Indeed, the score reminded me very much of the latter series (and of a Turkish Delight ad). The characterisations are all about the usual loyalty, friendship, teamwork and determination - ideal fodder to leave the youngsters in front of. The animation is adequate, and the story moves along apace with plenty of action to keep it skipping along nicely for just short of ninety minutes. It benefits from an engaging story and though really quite forgettable, I did quite enjoy it.');
