INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62d2d1dcd399e6004bfb74f6','NancyLDraper@gmail.com',682507,'By January 2022, the book had sold 12 million copies, making it one of the best-selling books of all time. Almost everyone in the theatre, yesterday afternoon, had read the book and were wondering if the movie could be as good as the book, so in my exit poll, of a dozen, or so, viewers, I asked then specifically, â€œDid the movie do justice to the book?â€ Without exception they said it had. (Although one reader thought the movie had a more definitive ending than the book.) Their ratings were 8s, 8.5s and two 10s. When I said that anything I rated over 8 would be worthy of a rewatch, it was unanimous that all of them would rewatch it, some thinking theyâ€™d like to read the book, again. So, these people, who came to see the movie, had high standards that they felt were met.
