INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624aff9c0582240051e50cb4','Geronimo1967',717151,'Based on the true story of Maurice Flitcroft who was almost as bad a golfer as me, Mark Rylance is on super form. He works at the Barrow-in-Firness shipyard just as it''s about to be wound down. Looking for something new to do, he alights on golf - a game he is singularly useless at. Having managed to enter the Open Championship and shoot a round of 121, just about everyone at the R&A wants to be shot of him - and so begins quite an engaging depiction of just how he tried to thwart them and play again. To be fair to Flitcroft, his golf did improve as his mantra of practice, practice, practice began to pay off. Sally Hawkins appears only sparingly, but is quite a good foil as his wife Jean and Rhys Ifans is also quite entertaining as the St. Andrew''s man determined that our "phantom" should never pick up a club again. The narrative is amusing, but it also swipes at the cliquey, snobby, culture that prevailed at golf clubs unwilling to welcome a working class man. Clearly, Rylance was up for the part. He is enjoying himself and that is contagious. Maybe you wouldn''t want to get into a golf buggy with him, or his slightly dodgy pal Cliff (Mark Lewis Jones) but a bit like "The Duke" (2020) it''s a charming and characterful British film that does raise a smile.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62a7ac84a8b2ca0052c6a57b','garethmb',718789,'The digital magicians at Pixar have returned with an origin story of one of their most famous characters. â€œLightyearâ€ opens with an explanation that Andy from â€œA Toy Storyâ€ was given a toy based on his favorite movie in 1995 and that this is the movie upon which the toy was based.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62abe05234e1520051e34c21','ChrisSawin',718789,'Like _Toy Story 4_, _Lightyear_ is an unnecessary installment to the Toy Story franchise, but is enjoyable nevertheless. Its homage to science fiction makes the animated film feel more like a sci-fi actioner rather than an animated film the majority of the time. It has a rich and palpable atmosphere that is gorgeously animated and is filled with the laugh out loud and heartfelt moments Pixar is typically known for.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ace8f4f859580093e6dcf1','Driver',718789,'Where has the "magic" gone? Disney muddles the mix once again and ruins a childhood favorite by removing the accomplished Buzz frontman Tim Allen for Chris Evans? I was so wanting to see the quick quips and humor a comedian such as Allen has always brought to the Toy Story franchise and sadly they went the other direction here. Formulaic and predictable. This could have been any other space-based children''s animation.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ae04c9595a5600513f1ab6','msbreviews',718789,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/lightyear-spoiler-free-review
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b0272262e86f0060852039','Geronimo1967',718789,'Just like in "Alien" (1979) a ship''s computer wakes some of the crew mid-trip when it detects an uncharted planet. Space Rangers "Buzz", "Hawthorne" and a rookie take the ship down for a look, but are soon facing some hungry plants and big bugs. He attempts to escape, but the ship (the "Turnip") clips a mountain top and crashes, destroying their power crystal. He determines to find a way to replace it - but each time he tests it out, his off-world moments become 4 years for those left behind, and so his repeated attempts to get them all home safely merely see him stay the same age as his companions grow old, marry, have children - grandchildren, even - then die. It''s on return from one of his tests, with a functioning power source designed by his auto-cat "Sox" - that he discovers their settlement is being besieged by the robot soldiers of "Emperor Zurg" and he, together with his cat and an enthusiastic youth training team must destroy the enemy ship and save the day. Director Angus MacLane did pretty much everything here and though it isn''t a bad animation, it could possibly have been doing with a few more objective eyeballs to keep it sharp. The story starts off strongly with some fast-paced dialogue and a bit of fun with the inhabitants of their new home. Quickly, though, it becomes a bit repetitive and starts to drag. Sentimentality creeps in a bit too much and as the plot unfolds, it does become a bit harder to establish just what this film has to do with "Toy Story" (1995) for which it is supposed to be a prequel (the plot towards the end reminded me of "Guardians of the Galaxy II" from 2017). The conclusion doesn''t fit at all - indeed, I wondered if this were merely the first of a few films that might, eventually, explain how "Buzz" ended up as the new favourite of "Andy". The production is good, but that is no longer anything to shout about with Disney/Pixar - it is what they do. This needed to build more on why we cared about "Buzz" in the first place, and it doesn''t really manage that. It picks up in the last fifteen minutes as the messages of teamwork and collaboration start to flow through the narrative but is really too long. It is still worth a watch on a big screen to appreciate the colourful visual effects.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ebc1c7273648005ac01542','TitanGusang',718789,'Lightyear is a lighthearted and fun sci-fi adventure. Let me get this out of the way first and foremost, the visuals in this film are spectacular. The artists who did this deserve a raise because this might be the best looking animated film I have ever scene. I really enjoyed the touch of changing the resolution at a certain point. With that out of the way, I really enjoyed this film, the exploration of a new world was really well done. I liked the time traveling elements that were presented, borrowing some from Interstellar, and it brought some really sad moments that nearly drew a tear from me. The cast of characters were funny and their evolution throughout the story was a joy to watch. I was not super impressed with this movies interpretation of Zurg. I just felt like there was more that could have been done with that. 
