INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b6aa269566580052bd4211','Geronimo1967',756999,'The thing about adapting a short story for cinema is that we tend to get a great deal of padding to get it to the duration. This film is certainly guilty of that, with the first half hour spent on way too much character establishment that really has very little to do with the gist of the story. Once it does get going though, it''s a cleverly crafted and well put together scary movie centred around "Finn" (Mason Thames). Bullied at school, he is protected by his friend "Robin" (Miguel Cazarez Mora) until he disappears. He isn''t the first child to disappear either, indeed five from this small community have gone missing over the last few weeks. "Finn" is walking home after school when he encounters a man who has dropped his groceries. Offering to help, next thing he knows he is in a grubby basement with only a soiled mattress and a disconnected phone on the wall. His mask-clad captor - who has something of the "Joker" about him - insists he is in no danger, but the phone on the wall starts to ring and the callers - the other five victims - warn him otherwise, and help him to try to best his nemesis. There are one or two jump moments, but mostly there is an effectively accumulating sense of menace well fuelled by confident efforts from Thames and his sister "Gwen" (Madeleine McGraw) who might have inherited her mother''s ability to see the future in dreams - a skill that may prove vital in helping the police save her brother from certain death. There are violent undertones, but very little actual violence is shown as the young man comes to terms with some of his own demons and to try to escape. The last ten minutes redeem it well, and there is something distinctly satisfying about the conclusion. Scott Derrickson has provided us with one of the better Blumhouse dramas of recent years that is sure worth a watch.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b8e8312e2b2c031ceb6121','ChrisSawin',756999,'With supernatural dread lifted directly from the likes of _Stir of Echoes_ and _The Sixth Sense_, _The Black Phone_ features a breakthrough performance from Madeleine McGraw while Ethan Hawkeâ€™s hauntingly memorable turn as The Grabber is felt in a hair-raising sense; like someone who has unknowingly snuck up behind you and waits in your peripheral for that dramatic reveal. _The Black Phone_ is a solid, pulse racing horror film that packs a punch, but seems like the type of film that simply wonâ€™t be as delectable on repeat viewings.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b9b027229ae21212d3dc5c','msbreviews',756999,'FULL SPOILER-FREE REVIEW @ https://www.msbreviews.com/movie-reviews/the-black-phone-spoiler-free-review
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62c4419a2da84606af361e6d','TitanGusang',756999,'The Black Phone is a paranormal abduction thriller that balances the tension/despair of being trapped and the ghost elements very well. The movie does a great job setting up the main characters in the beginning that gives you a relationship with them and genuine desire for them to succeed. There are a few plot points that are a little questionable, but are they are minor nitpicks and didnâ€™t pull me out of the story too much. The performances all around were great. Ethan Hawke does fantastic in his limited screen time. He conveys the mental state of the Grabber with such nuance, it really makes the hair on the back of your neck stand up. The children do very well too, especially in the more emotionally heavy scenes. A few of the classmates performances in the beginning were a bit awkward.  Overall, I had a great time with this movie and it is a testament to the directors and writers that they could adapt such a creative thriller from a short story.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62dd0c8f5ca7040b29901658','Horseface',756999,'I had to abandon this very early on, as I couldn''t see anything. I''m pretty sure it was daytime, because kids were going to school, but it was so darkly lit that it looked like late dusk. I think there was a sun in the sky, but it might have been a firefly. I put my TV on "vivid," but it couldn''t remedy the problem. Maybe there''s a good movie in here, but the production is clearly broken, so if you have an HDR TV, you won''t be able to see anything.');
