INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624afff38c7b0f006379aa44','Geronimo1967',760104,'Hmmm - I didn''t really get what all the fuss is about with this. A group of folks rent a house on the farm of an elderly couple. They arrive and settle down to make their porn film. Director "RJ" (Owen Campbell) isn''t happy when his girlfriend "Lorraine" (Jenna Ortega) wants to join in and determines to skedaddle in the middle of the night. Suffice to say, he doesn''t quite manage and next thing the whole load of them are in peril of their lives. This contains one of the daftest old age sex scenes I have ever seen, but that is all I found even vaguely memorable about this rather derivative film. Sure, it''s got an hungry alligator but the ending is weak, and the characters just parodied everything crass from the tacky late 1970s adult entertainment industry in a really flat, sterile, fashion. Takes too long to get going, and certainly does not need to be seen on a big screen. More V than X, I''d say.');
