INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62e61b311bf266005da333f5','Geronimo1967',762361,'OK, so luck does play a disproportionately big role in this rather far-fetched comedy drama, but all of that is redeemed by two really quite engaging performances from Olivia Coleman and Charlie Reid. The latter is a young lad who doesn''t like the idea that his roguish father is about to appropriate some charity money, so absconds with it in a stolen taxi. Unbeknown to him though, his cab already has two passengers - "Joy" (Colman) and a young baby. What now ensues are some fun escapades as the young man realises that his middle-aged passenger - who is dressed in a fetching air-hostess yellow for most of the film - is trying to get her newborn to her sister for adoption and he begins to suspect that she might just be a bit of a commitment-phobe. It''s a road trip film with a difference. Both characters gel well here and the young Reid has a mischievous confidence that belies his young years - indeed there are more than a couple of quite entertaining role-reversal scenarios to relish. The script is frequently pithy and lively and the scenery enjoyable to admire as the pair leap from frying pan to fire on an amiable journey across Ireland trying to avoid the Garda and his father en route. Olivia Colman is effective here, she has quite good comedy timing but the film really belongs to Reid and is actually much better than I was expecting.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62fa14f31cac8c007a30a2c8','Geronimo1967',762504,'I''m always very nervous when a film''s advertising campaign leads extensively on the director and not on the acting... To be honest, here, I really couldn''t quite see what the fuss was about on either front. A pretty monosyllabic "OJ" (Daniel Kaluuya) lives with his feisty sister "Emerald" (Keke Palmer) on a remote stud farm where they provide horses for the movies. When strange things start going bump in the night, and the horses start behaving oddly, then disappearing all together - they are bemused. Off to town they go where they meet local geek "Torres" (Brandon Perea) who is full to the brim with alien conspiracy theories and who comes and installs some CCTV for them. What now ensues is a quirky, rather poorly paced sci-fi caper that takes far too long to get going and then when it does, well it sort of rumbles along with loads of pretty repetitive photography, minimalist dialogue and an ending that made me chuckle - and I am not sure that was Jordan Peele''s intention. The plot reminded me of something from the "Outer Limits" from the 1960s! There is certainly some lovely scenery to be admired in this California valley but all in all I was totally underwhelmed by this film, the best bits I felt, were seen in the trail.');
