INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('624172c3c740d9005d761a8c','Geronimo1967',763285,'So here''s the gist. "Will" (Yahya Abdul-Mateen II) needs $231,000 urgently, so he taps up his brother "Danny" (Jake Gyllenhaal) who, as luck would have it, is on that very day about to hit a bank for $32m. All he has to do is drive and his worries are a thing of the past. They manage to relieve the bank of the cash ok, but horny young police officer "Zach" (Jackson White) becomes a fly in their ointment when he decides to ask one of the cashiers out on a date, and gets caught up in the now much more precarious raid. He gets shot, and as the ambulance is leaving to take him to hospital the two robbers jump on board as their ticket out of the now police-strewn crime scene. Luckily, onboard the ambulance, is feisty no-nonsense paramedic "Cam" (Eiza GonzÃ¡lez) who now has to keep the critically ill officer alive whilst her two passengers try to evade the might of the LAPD with their loot. What now ensues is just ridiculous. This sixteen tonne truck manages to evade snipers, souped-up police cars, helicopters all whilst having a critically injured man in the back. It seems to have no issues running out of gas; and must have an axle and suspension system that wouldn''t be out of place on a Boeing 747. Gung-go police captain "Monroe" (Garret Dillahunt) demonstrates adequately that the more resources you have, the cockier you become - and the less successful; and the introduction of FBI man "Anson" (Keir O''Donnell) a college pal of "Danny" who has to rush from a marriage guidance session with his husband to try and apprehend the fugitives just tops off this rather preposterous narrative. The production is very good; the use of drones and high speed photography does create an effective image as the ambulance continues to evade pursuit, but the dialogue is dreadful. Lots of repetitive expressions with hardly a smile to be had as the plot descends willingly into the absurd. Luckily, we get to come up for air for a moment or so thanks to Christoper Cross'' "Sailing" but otherwise this is a relentless chase movie with it''s root firmly placed in fantasy. The ending takes 2Â¼ to come, and when it does it is as inevitable as it is poor. I''m sorry, but this is nobody''s finest work and being the only person at the screening I couldn''t help but wonder if others knew better than me - and stayed at home!');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('625cb0e4bf09d100993544a3','ChrisSawin',763285,'Buried deep within _Ambulance_â€™s loud, flashy action, sickening editing, overstimulated filming techniques, and a screenplay that seems like it was fished out of a port-a-potty is a somewhat thrilling film. Jake Gyllenhaal is a cashmere obsessed lunatic that you canâ€™t help but love, but _Ambulance_ is a gaudy and sloppy excuse of an action film otherwise.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ed87cfc4ad590082c60d16','mysterygirl803',765172,'> An awesome epic and jammed pack adventure!! I watched the show and then this movie and it''s been amazing!! Slept on and underrated gem of a movie. I say everyone needs to watch it and don''t judge it based on past tmnt shows and movies. Enjoyed the references, Easter Eggs and Beautiful action scenes. Some of the best work of this year! ðŸ‘Œ People need to stop hating on such a masterpiece.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('631e59861ac292007f0fac27','Geronimo1967',766475,'Sam Rockwell and Saoirse Ronan gel really well together in this rather entertaining spoof of all thing Agatha Christie. The latter is the newbie constable "Stalker" - an enthusiastic young woman who is saddled on the experienced, gin-loving, inspector "Stoppard" when the pretty unlikeable film director "KÃ¶pernick" (Adrien Brody) is beaten to death with a sewing machine! It turns out that he had just been engaged to direct a big screen version of the legendary "Mousetrap" play that had just celebrated it''s hundredth performance at London''s Ambassador''s Theatre. What now ensues is a really engaging whodunit with flashbacks galore as the two police officers have to learn to trust each other as well as to handle the high drama amongst a cast of thespians, an avaricious producer and, of course, a publicity seeking police Commissioner. Rockwell delivers strongly as the rather laconic and disillusioned officer (he reminded me a little of Johnny Depp''s "Abberline" in "From Hell" from back in 2001) and Ronan brings plenty of amusement (and courage) to her role as his aspirational sidekick who is always jumping to conclusions. As ever with Christie stories, you just know that the perpetrator of the crime is going to be the least important character so there''s not oodles of jeopardy here, but it ends well with all assembled in a creaking stately home where it all ultimately falls to the author - "Moaning Myrtle" herself - to solve her own mystery. Tom George has assembled a decent supporting cast with both Harris Dickinson quite effective as a rather effete Richard Attenborough and Ruth Wilson as the shrewd theatre producer "Petula" and they help to deliver a pace and humour that is enjoyably amiable for just over ninety minutes. I''ve sat in the Ivy restaurant opposite this theatre for many a year but have never actually seen the play. A bit like with this film, you mustn''t disclose the ending or maybe you''ll be next... Good fun!');
