INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62fa27492588230082205172','Geronimo1967',766507,'OK. Please explain. Is this just supposed to be "Pocahontas" meets "Predator"? Just because it calls itself an "origin" story doesn''t mean it needed to be made - and I''m sorry, but I just didn''t understand whom this is for. It has none of the suspense or tension of the original Arnie film from 1987, and I kept expecting Peabo Bryson to burst into song at some point as these hopelessly out-gunned/arrowed/tomahawked Commanche - and, to be fair, most of their critter counterparts, seem to be on the menu of this visiting alien creature who has invisibility, enduring strength and some pretty whizzy weapons at his disposal. It is a little bit gory, but no more so that you might see on your latest Blumhouse effort, and to be fair it doesn''t hang about - there is plenty of action once it gets started. The acting, however, is really neither here nor there and of course, there isn''t the slightest degree of jeopardy as the whole thing sort of lurches along to a quirkily silly ending that made me smile. The effects are pretty old hat and though the human characters are tenacious and courageous enough, the story has just too much of the ridiculous David and Goliath to it. I did wonder why it didn''t get a cinema release, but now I have seen it, I reckon I know why. It''s watchable enough, but I can''t say it''s much good or the least memorable.');
