INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('632614c1a3d027007f9e27a2','Geronimo1967',770684,'Michael Lombardi is the aptly named "Bishop" - he''s a rural pastor - who traditionally shuns confrontation and generally encourages others to do the same. Until, that is, his daughter has a run in with a gangland hoodlum who has a car stashed with cocaine, loot - and a man who is not in great shape. She attempts to flee but while being chased chooses to ring her dad, rather than 911 (or maybe drive off in the general direction of the police station!?). Anyway, the remainder of this terribly lacklustre revenge thriller follows dad''s attempts to avenge his daughter. For a previously gentle man, he adapts to the brutality of his new environment with an ease that made me think that if Sigourney Weaver had had him in the "Alien" films, those acid bleeding critters wouldn''t have lasted twenty minutes. That''s really the problem here. The scenario is just daft. Right from the get go when we have an altercation over a Christmas tree through to the very end, it''s all just predictable and implausible tosh. The acting is college project standard, as is the writing and the direction. Indeed, quite how this got a cinema release at all is a far more worthy and ponderous question than anything raised by the script. Nope, I really wouldn''t bother.');
