INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6289895e134d580067c534d5','ChrisSawin',780609,'People will hate _Men_ if they go into it wanting a straightforward story or a film that has one, clear cut meaning once those end credits crawl across the screen. _Men_ doesnâ€™t offer either of those things. The film features stunning cinematography, a mesmerizing forest sequence, and a thrilling score that is as unsettling as it is operatic. Rory Kinnear is exquisitely chilling. This is the type of horror film that is purely, disgustingly, and gloriously nasty and ambiguous. _Men_ is simultaneously a film you shouldnâ€™t think too much about and yet absolutely think about all the time once itâ€™s over.
