INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('631a5dcb62fcd3009a895208','JPRetana',793992,'Three Months is such a sweet, touching little film that it makes me wish the script didnâ€™t force the protagonist, Caleb, to ride around solo on a tandem bike. Sure, Caleb has an emotional attachment to the thing (it belonged to his dead father), it comes in handy to the plot now and then (in a â€˜hey, I have an extra seat in case you need a liftâ€™, or â€˜oops sorry, thereâ€™s three of us and only two seatsâ€™ sort of way), and it doesnâ€™t even look like itâ€™s that much harder than riding a normal bike â€” but still, the whole idea smacks of a desperate cry for attention; writer/director Jared Friederâ€™s way of making sure we know how quirky his main character is supposed to be.
