INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6280797e8261ee00515a4e4c','SpencerStaggs',809140,'Let me start off by saying that I completely understand all of the hate this film is getting, and that''s because for the first half of the film I hated it too. For too much of this film, a lot of the characters are just unlikable slobs . . . especially Mel Gibson''s character of Bill Long. Also, the story plays out . . . well, it plays out terribly for the first half of the film. It wasn''t until later in the film when Stuart Long decides to become a preacher that I was actually invested, and why''s that? That''s because Long was an absolute piece of trash that I didn''t want to watch for the first half of the film. This does not go without saying that by the end I liked Stuart Long''s character in the film, but I couldn''t like him for the first half.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62937b8c76eecf590ca3317d','Geronimo1967',809140,'Mark Wahlberg is competent here as the eponymous boxer who takes a shine to the young church-going Carmen (Teresa Ruiz). He can''t get near her, so he somewhat opportunistically decides to join her church and see if that helps. Thing is, pretty quickly he discovers that there is something to this "God" thing, and decides to try and get himself ordained for the priesthood - leaving all thoughts of the girl behind. Meantime, he discovers that he is suffering from a degenerative disease that will prove debilitating as he ages. It''s one of those inspirational stories this, but I just didn''t particularly like or empathise with "Stu". I found his profound and fairly sudden Damascine conversion hardly explained in the context of the film and except for a few decent contributions from the always reliable Jacki Weaver (his mother) the rest of this was all a bit lacking in substance. I never felt like I knew what made this man tick! It is nice to see Malcom McDowell back on the screen, and Mel Gibson is perfectly adequate as his rather indifferent father - but sadly, this whole film is a just another, sometimes touching, biopic of one man of many who live to inspire through their church (or not) whilst facing adversities and trials that trouble many people. It is watchable, but I''m afraid equally forgettable.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62ad74a34142910092116ea6','Geronimo1967',814340,'Cooper Raiff did just about everything on this quickly paced and rather touching comedy drama. He plays the 22-year old "Andrew", whom we first meet as a young boy who has a crush on a party starter. Dejected after his inevitable rejection, we skip on a few years to when he is using his considerable social skills to get folks up and dancing at the seemingly never ending series of bar/bat mitzvah''s in his town. It''s at one such gathering that he meets "Domino" (Dakota Johnson) and her autistic daughter "Lola" (a strong performance from Vanessa Burghardt). The challenge is to get the shy young girl to dance and the result is a sitter job and a relationship, of sorts, with her mother - already engaged to the frequently out of town "Joseph" (RaÃºl Castillo). What now ensues is a gently comedic, but quite potent story that offers the young and charismatic "Andrew" (he reminded me a lot of Jack Whitehall!) with an opportunity to shine. It''s about love, yes, but it''s about hope and managing expectations too; with this young man, like so many of us at that age, trying to start out in life on as sure a footing as he can. It''s not all a barrel of laughs - there is plenty of emotional turmoil for him, "Domino", his mother (Leslie Mann) and for his coming-of-age brother "David" (Evan Assante) and it illustrates also quite effectively just how cruel youngsters can be to each other; and how blind loyalty from their parents doesn''t help (though in this film, there are quite entertaining side-effects!). There is chemistry here between the confident Raiff and both Johnson and Burghardt, the soundtrack gets your toes tapping and the conclusion offers a reality that I rather appreciated. It''s good, this.');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('626c5151c56d2d11b0e28095','bastag',815873,'Full analysis at Spotamovie.com - **Intro** - Director and writer Srinivas delivered a hilarious comedy, where sacred and profane mix each other in a combination of laughters and insights about love. Of course, we are talking about Old Monk, a 2022 Indian production that will leave you entertained and more careful with your relationships and Gods. - **The Story** - In heaven, Krishna is busy watching sports on TV while he forgets something critical for his future and happiness. Meantime Narada comes to visit him and talk about women. The conversation becomes hot and challenging, and it will upset Krishna. Narada crossed the limits and, therefore, Krishna punishes him. How? Narada must leave heaven, become human, and find a girl to love and marry, seeking her familyâ€™s approval. Krishna chose the most painful of the pains: love. So, how will Narada survive and adapt to the new society?  Will Narada find love and regain his position in heaven?
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('626cb799d7107e0050a2fc39','ChrisSawin',818397,'_Memory_ juggles so many subplots to unsatisfactory results. Itâ€™s as if the story throws a ball in the air for every concept in the film (Alzheimerâ€™s, human trafficking, the FBI vs the police, rich people getting whatever they want, etc) only to allow each ball to smack against the ground without trying to catch them after their initial toss. For a film about a guy who kills people with the authorities chasing him for nearly two hours, _Memory_ is a monotonous bore. Not even Liam Neeson lighting himself on fire to cauterize a bullet wound can save what is otherwise a forgetful and fatigued memoir of a hoary hit man.
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('61ff3cdeb3e6270068dd7af9','SeanDillon',818647,'A teen romance like there are hundreds of others: a girl a boy, different social classes, one not quite attracted to the other, blah blah blah, they fall in love. If you''re in the mood for a romantic movie that follows the most basic template of romantic movies, then watch it. But if you want something original that will surprise and excite you then look elsewhere.');
