INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('6328ce181f98d10092312e92','Geronimo1967',819876,'Whilst certainly nowhere near his best, this is still quite an intriguing drama from David Cronenberg. It all centres around "Saul Tenser" (Viggo Mortensen) who uses his own body to grow (or "cook") extra organs which he and his assistant "Caprice" (LÃ©a Seydoux) extract as part of rather gruesome, but popular, theatrical performances. Meantime, "Dotrice" (Scott Speedman) is reeling from the suffocation of his young plastic-eating son (by his own wife) and so convinces the exhibitionists that an autopsy revealing the internal digestive organs of this most unusual of mutations would make for excellent viewing. Don McKellar ("Wippet") and his colleague "Timlin" (Kristen Stewart) run the government department for organ registration and needless to say they take a dim view on the legality of some or all of these activities... or do they? The concept is interesting and ethically highly dubious but sadly the execution is a bit lacklustre and there is way too much dialogue and, oddly enough here, too little use made of the special effects that are at times quite disturbing to watch and are, no pun intended, rather at the heart of the story. Stewart''s very presence suggests her character has a more significant part in the proceedings but her appearances themselves are actually quite sparing which is always a bonus for me! It does take a while to get going, and somehow the ending is all rather underwhelming but it still has enough traces of the director''s unique style and imagination to make it worth a watch - once');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('626fc3196f53e11b4d192ea0','Geronimo1967',820446,'This latest offering from Julian Fellowes presents two stories centred around the landed "Grantham" family. The first sees the dashing "Barker" (Hugh Dancy) come to Downton to make a film - that will pay for a much needed new roof - and soon makes friends with the absentee-husbanded "Lady Mary" (Michelle Dockery). Sadly, though, he soon discovers that silent movies are rapidly losing their charm - and the stars, especially an entertaining "Myrna" (Laura Haddock) are facing a challenge that ended the careers of many a silent movie star - a voice that could strip paint. Meantime the grown ups head to the south of France to investigate a beautiful villa that has been bequeathed to the elderly Dowager Countess, and where they must tread a fine line between a generous welcome and open hostility from the erstwhile owners of this lavish property. We flit between the two threads effortlessly, with plenty of grand cinematography at both Highclere Castle and on the CÃ´te D''Azur. The script is frequently quite amusing - with most of the best lines from those "downstairs"; there is a soupÃ§on of romance, the odd bit of melodrama and loads for fans of these characters to enjoy. I found the Deborah Mitford-esque ending quite poignant too, with the Dames Maggie Smith and Penelope Wilton alongside a film-stealing scene from the underused Kevin Doyle ("Moseley") adding weight and pith to the story. I still struggle with Elizabeth McGovern, Hugh Bonneville is most certainly not at his best here, and the French story seems contrived at times, but essentially this is just another stylish template for some well established acting talent to deliver well established roles in a characterful and engaging fashion. Looks good and is, but I have to say - I do hope it really is the end of an era...');
INSERT INTO reviews(review_id,username,movie_id,review) VALUES ('62b0c8a85a5ed00091b3f26f','narrator56',820446,'After all this time, I didnâ€™t expect Julian Fellowes to mess with his formula and start having radical plot twists and unexpected tragedies and mayhem. It is a comfortable family viewing franchise. If anything, except for the same-sex relationship element, it is less adventurous than it used to be. But that is all fine with me. It is like the new All Creatures Great and Small series: I know what to expect, but with an ensemble characters I know and like I donâ€™t care.
